import React, { Component } from "react";
import Button from "../Button/button";

interface CardProps {
  children: React.ReactNode;
}

class Card extends Component<CardProps> {  
    render() {
      return (
        <>
          <div className="container max-w-sm px-6 py-8 shadow-xl shadow-gray-300 rounded-xl flex flex-col justify-between gap-3">
              <div className="flex justify-between">
                  <div>
                      <div className="flex items-center mb-3 w-min pr-2 rounded-xl bg-red-100">
                          <div className="w-6 h-6 mr-1.5 rounded-xl bg-gray-100"></div>
                          <p className="font-normal text-xs text-gray-600">Pending</p>
                      </div>
                      <h2 className="font-medium text-base mb-3 text-gray-700">Spain</h2>
                      <p className="text-gray-400 font-medium text-sm mb-1.5">5 days plan, 5GB</p>
                  </div>
                  <div className="bg-gray-300 w-20 h-20 m-3 flex flex col">
                    <span>0.5</span>
                    <span>/ 2GB</span>
                  </div>                  
              </div>
              <Button>
              </Button>
          </div>
        </>
      );
    }
  }
  
  export default Card;

